            string[] ac114 = new string[SIZE] { "Бейлѣтъ", "3", "33", "Зима", "День Бога Перуна. Вот, что пишется об этом празднике в Ведах. В далекой древности Бог Перун освободил из Пекла людей. Всех кого завлекли туда завлекли обманом и силой, и дал им возможность вернуться к Родным Очагам. Когда люди вышли из Пекла, Бог Перун завалил вход в Пекло (Врата Междумирья) Кавказскими горами. Но на землю, помимо людей выскользнула и всякая нечисть. Освобожденных людей с радостью встречали их родные. А когда к ним в дома стала заявляться нечисть, от нее откупались дарами. С той поры, люди отмечают Праздник Перемен (сейчас он известен как Коляда). Часть людей обряжаются в разных чудищ (ряженые), изображая нечисть, и ходят по домам. Чтобы не пускать нечисть (ряженых) в дом, и не иметь в доме несчастья, им на пороге дают откуп в виде печенья, сдобы и других вкусностей. Получив их нечисть уходит, ибо она хоть и любит все сладкое и вкусное, но терпеть не может радости и счастья. После Праздника Перемен (Менари), народ вспоминал о тех, кто так и не вернулся из Пекла. Поэтому в народе стали отмечать Неделю Памяти Предков. И пока люди вспоминали о всех своих Предках, Бог Перун ходил по земле и уничтожал нечисть. Ибо нечисть объедалась сладким так обильно, что не могла двигаться. 9 кругов пришлось сделать Перуну по Земле, по одному кругу в день, чтобы найти и уничтожить всю нечисть. И, как сказано в Ведах - и победиша злыя силы, вонзил в землю свой сияющий меч Бог Перун. Позже это отразилось в легенде о мече в камне. С той поры, люди стали отмечать Зимний День Перуна, как праздник победы над злом. Проходят 9 кругов по свастическому лабиринту, который называется Перунов Путь." };
