            string[] ac185 = new string[SIZE] { "Дайлѣтъ", "5", "23", "Весна", "Начало Великого Поста (13 дней). Красногор. Масленница. Второй День Весеннего Равноденствия. В этот день празднуются проводы Богини Зимы Марены в ее Ледяные Чертоги, находящиеся на севере. В этот день зажигается огромное огневище (костер), в которое каждый присутствующий на празднике, кладет маленькую куколку, сделанную из соломы, на которую наговариваются пожелания счастья, радости, хорошего урожая и т.д. Вместе с куклой в огонь кладутся блины и зерна (просо, овес для произрастания обильной пищи для домашней скотины), чтобы Боги даровали обильный урожай. Проводятся народные гуляния и прыжки через отдельное (не жертвенное) огневище, чтобы очистить свои Душу и Телеса. Водятся хороводы, игрища и т.д. В эти два дня Весеннего Равноденствия запрещается употребление хмельных и спиртных напитков. Не пейте питья хмельного, не скажите бранного слова. Не употребление соблюдается всеми, кроме мужей, достигших возраста 3 Круга Лет (48 лет), выполнивших Долг перед Родом (9 детей) - 1 чарка, или имеющих Потомственный Круг (16 и более детей) - 2 чарки Сурицы (27 грамм). Чарки им наливает Родан (Предводитель Рода). В период Поста непозволительно употреблять жирную мясную пищу (кроме мяса курицы и кролика), жирную рыбу, масло (кроме растительного), молочные продукты. Все остальное нежирное можно." };
